import React from 'react';
import { Card, Image} from 'semantic-ui-react';

const Game = (props) => {
    const { game } = props
    return (
        <div className={"card"}>
            <img src={game.img} />
            <div className="">
                <Card.Header>Game Name: {game.title}</Card.Header>
                <Card.Description>Game Description:{game.details}</Card.Description>
                <Card.Meta>Game Price:{game.price}</Card.Meta>   
            </div>
        </div>
    )
}



export default Game;
